# Registered from hosts inventory.
[all:vars]
ansible_ssh_user=root
ansible_ssh_pass=password
ansible_ssh_port=22

可能会遇到这样的报错：
ansible all -m ping
# OUTPUT:
# 10.0.0.100 | FAILED! =&gt; {
